import {
  CountdownCircleTimer,
  useCountdown,
} from "react-countdown-circle-timer";
import "./style.css";

const CounterTimer = () => {
  const { remainingTime } = useCountdown({ isPlaying: true, duration: 10 });

  return (
    <div>
      <h1>
        <a
          href="https://www.reactlabs.ai/"
          target="_blank"
          rel="noopener noreferrer"
        >
          React Labs
        </a>
      </h1>
      <h2>ReactJS Assignment</h2>
      <div id="countDownTimer">
        <CountdownCircleTimer
          size={250}
          isPlaying
          duration={10}
          colors={["#34AD00", "#B3BB2B", "#FF0000"]}
          colorsTime={[10, 4, 0]}
        >
          {remainingTime}
        </CountdownCircleTimer>
      </div>
    </div>
  );
};

export default CounterTimer;
